                        Помоги.рф
                    </Link>
                    <p className="helpText">Поможем ближнему нашему...</p>
                    <Link to='/auth' className="authLink">Войти</Link>
                </div>
                <div className="underNav"></div>
        </header>
    );
};

export default Navbar;
